import React, { Component } from "react";

class MainContent extends Component {
  state = {
    appTitle: "Clientes",
  };

  render() {
    return (
      <div>
        <h4 className="border-bottom m-1 p-1">{this.state.appTitle}</h4>
      </div>
    );
  }
}

export default MainContent;
